- input: "TEXT\x1CC00114439\x1CTEXT-00001\x1C\x1CF3XA\x1CPlease note that the report
    is being amended to restore the debt schedule as originally filed with respect
    to J. Blair Butterworth Assocaties for debts totaling $73,266.78.  The report
    was initially amended because of a mistaken belief that mailings for which these
    vendors were paid was disseminated on October 13, 2008. However, we recently discovered
    that the mailings were disseminated on October 23, 2008. Therefore, these debts
    should not have been included on either report since they were incurred and paid
    within the Post-General reporting period.  The Schedule L-A aggregate year-to-date
    for Levin contributions received by the WA Federation of State Employees shows
    an aggregate year-to-date amount of $20,000, of which $10,000 was transferred
    back to non-federal on 3/31/08 after the error was discovered.  See Schedule L-A
    of this report, Schedule L-B of the April monthly for the transfer back, and Form
    99 (FEC-374229) connecting the transfer back to the WA Federation of State Employees.
    \ All salaries, related taxes, and benefits reported on Schedule H4 are for employees
    working 25% or less of their time during the month on federal election activities;
    and all salaries, related taxes, and benefits on Schedule B, Line 30b are for
    employees working greater than 25% of their time during the month on federal election
    activities.  The transfer of the joint fundraising proceeds received during this
    reporting period from the DNC State Party Victory Fund Program represents the
    WSDCC's share of proceeds for contributions received during this or prior reporting
    periods.  The memo entries for these contributions are included in this or a prior
    report of the WSDCC.\n"
